import React, { useState } from "react";
import CardInput from "../components/CardInput";

interface User {
  name: string;
  username: string;
  email: string;
  password: string;
}

const Register: React.FC = () => {
  const [formData, setFormData] = useState<User>({
    name: '',
    username: '',
    email: '',
    password: '',
  });

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    try {
      const response = await fetch("https://pandela-youtube.onrender.com/api/profiles/setup/<str:pk>/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const data = await response.json();
      console.log("DATA:", data);
    } catch (error) {
      console.error('There was a problem with the fetch operation:', error);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <CardInput
          inputsData={[
            { title: "Your name", type: "text", name: "name" },
            { title: "Choose a username", type: "text", name: "username" },
            { title: "Your email", type: "email", name: "email" },
            { title: "Choose a password", type: "password", name: "password" },
          ]}
          formTitle="Registration"
          buttonText="Register"
          linkText="Already registered? Log in"
          to="/login"
          function={handleSubmit}
        />
      </form>
    </div>
  );
};

export default Register;
